import React from 'react';
import PieChart from 'react-minimal-pie-chart';
import './CycleGraph.css';
import Loader from "../reusableComponents/Loader";


let terminated=0;
let passed=0;
let failed=0;
let timouted=0;


class CycleGraph extends React.Component {
    render() {
        let view=<Loader/>

        if (this.props.data.length>0){

            for(let i=0;i<this.props.data.length;i++){
                terminated+= this.props.data[i].Ex_Terminated;
                passed+=this.props.data[i].Ex_Passed;
                failed+=this.props.data[i].Ex_Failed;
            }

            view=<div>
                <PieChart data={[
                    {
                        title: 'Terminated',
                        value: parseInt(terminated),
                        color: '#e3c877'
                    },
                    {
                        title: 'Passed',
                        value: parseInt(passed),
                        color: '#45c176'
                    },
                    {
                        title: 'Failed',
                        value: parseInt(failed),
                        color: '#b02d2c',

                    },
                    {
                        title: 'Timeout',
                        value: 0,
                        color: '#55b8cc',
                    }
                ]}

                          lineWidth={30}
                          paddingAngle={5}
                          lengthAngle={-360}
                          style={{height: '200px'}}

                          label={({ data, dataIndex }) =>
                              Math.round(data[dataIndex].percentage) + '% '+ `${data[dataIndex].title}`
                          }
                          labelStyle={{
                              fontSize: '5px',
                              fontFamily: 'sans-serif'}}
                          labelPosition={120}
                          animate


                />
                <div className="containerTitles">
                    <div><span className="dot yellow"/>Terminated</div>
                    <div><span className="dot green"/>Passed</div>
                    <div><span className="dot red"/>Failed</div>
                    <div><span className="dot blue"/>Timeout</div>
                </div>
            </div>
        }





        return (
            <div className="ui container">
                {view}
            </div>
        );
    }
}

export default CycleGraph;
